import React from "react";
import GoogleApiWrapper from "./mapsAPI";
import "./LocationData.css";

const LocationData = props => {
  return (
    <div class="location-data">
      <div id="coords">
        <p>Latitude: {props.lat}</p>
        <p>Longitude: {props.long}</p>
      </div>
      <div id="mapContainer">
        <GoogleApiWrapper
          lat={props.lat}
          long={props.long}
        />
      </div>
    </div>
  );
};

export default LocationData;
